          ],
          "default": null,
          "title": "Format"
        }
      },
      "required": ["title"],
      "title": "Publication",
      "type": "object"
    },
    "WorkType": {
      "description": "Represents the type of work referenced in a library card.",
      "properties": {
        "type": {
          "enum": ["Dissertation or thesis", "Reference"],
          "title": "Type",
          "type": "string"
        }
      },
      "required": ["type"],
      "title": "WorkType",
      "type": "object"
    }
  },
  "type": "object",
  "properties": {
    "type": {
      "$ref": "#/$defs/WorkType"
    },
    "author": {
      "$ref": "#/$defs/Author"
    },
    "publication": {
      "$ref": "#/$defs/Publication"
    },
    "library_reference": {
      "$ref": "#/$defs/LibraryReference"
    }
  },
  "required": ["type", "author", "publication", "library_reference"],
  "title": "Document",
  "type": "object"
}

